class FragmentHome : Fragment(), CallBack {

    private lateinit var binding: FragmentHomeBinding
    private lateinit var adapter: ItemAdapter
    private lateinit var adapter_image: ImageSliderAdapter
    private lateinit var userViewModel: UserViewModel
    private lateinit var jobViewModel: JobViewModel

    private val list = arrayListOf<Job>()

    private var list_image: List<Image> = arrayListOf(
        Image(
            "data:image/jpeg;base64,"
        ),
        Image(
            "data:image/jpeg;base64,"
        ),
        Image(
            "data:image/png;base64,"
        )
    )

    override fun onCreateView(
        inflater: LayoutInflater,
        container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View {
        binding = FragmentHomeBinding.inflate(inflater, container, false)

        val view = requireActivity().findViewById<BottomNavigationView>(R.id.bnv_view)
        view.visibility = View.VISIBLE


        adapter_image = ImageSliderAdapter(list_image)
        binding.slider.autoCycleDirection = SliderView.LAYOUT_DIRECTION_LTR
        binding.slider.setSliderAdapter(adapter_image)
        binding.slider.scrollTimeInSec = 3
        binding.slider.isAutoCycle = true
        binding.slider.startAutoCycle()

        adapter = ItemAdapter(list, this)
        binding.rvList.adapter = adapter
        binding.rvList.layoutManager =
            LinearLayoutManager(FragmentHome().context, LinearLayoutManager.HORIZONTAL, false)

        binding.rvList2.adapter = adapter
        binding.rvList2.layoutManager =
            LinearLayoutManager(FragmentHome().context, LinearLayoutManager.HORIZONTAL, false)

        jobViewModel = ViewModelProvider(requireActivity()).get(JobViewModel:: class.java)
        jobViewModel.getListJob(SearchParam("",""),0)
        jobViewModel.dataJob.observe(viewLifecycleOwner, {
            if (it != null) {
                list.clear()
                list.addAll(it.data.jobs)
                adapter.notifyDataSetChanged()
            }

        })


        userViewModel = ViewModelProvider(requireActivity()).get(UserViewModel::class.java)
        userViewModel.getDataUser()
        userViewModel.data1.observe(viewLifecycleOwner, {

            if (it== null) {
                binding.imgAvtUser.setImageResource(R.mipmap.ic_launcher)
            } else {
                Glide.with(binding.imgAvtUser)
                    .load(Const.BASE_URL + it.data.avatar?.replace("\\","/"))
                    .placeholder(R.mipmap.ic_launcher_round)
                    .error(R.mipmap.ic_launcher)
                    .into(binding.imgAvtUser)
            }
        })



        binding.tvViewAll1.setOnClickListener {
            val action = FragmentHomeDirections.actionFragmentHomeToFragmentListJob()
            findNavController().navigate(action)
        }

        binding.tvViewAll2.setOnClickListener {
            val action = FragmentHomeDirections.actionFragmentHomeToFragmentListJob()
            findNavController().navigate(action)
        }

        binding.tvJobSavedApplied.setOnClickListener {
            val action = FragmentHomeDirections.actionFragmentHomeToFragmentHistory()
            findNavController().navigate(action)
        }

        return binding.root
    }

    override fun onClick(job: Job) {
        val bundle= Bundle()
        bundle.putSerializable("job",job)
        findNavController().navigate(R.id.action_fragmentHome_to_fragmentDetailJob,bundle)
        list.clear()

    }

    override fun onLongClick(job: Job) {
        TODO("Not yet implemented")
    }

    fun getListJob(){
        lifecycleScope.launch {
            withContext(Dispatchers.Default) {


            }
        }
    }

}

